import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";

class App extends React.Component {
  state = { apiresult: null };
  GetItemsFromAPI = () => {
    this.setState({ apiresult: "sdjhsda" });

    axios
      .get("http://localhost:52564/Api/Student/Studentdetails")
      .then(response => {
        this.setState({ business: response.data });
        debugger;
      })
      .catch(function(error) {
        console.log(error);
      });
  };

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img
            src={
              "https://upload.wikimedia.org/wikipedia/commons/6/6c/Star_Wars_Logo.svg"
            }
            height="420"
            width="420"
            alt="logo"
          />

          <button className="specialcls" onClick={this.GetItemsFromAPI}>
            Do. Or do not. There is no try
          </button>
          <div>{this.state.apiresult}</div>
        </header>
      </div>
    );
  }
}

export default App;
